【キス マットシフォンパウダーモイストUV 01 ライトベージュの詳細】<br>●モイストヴェールパウダー配合でしっとりうるおいながら、キメの細かいふんわりマシュマロ美肌に。<br>●優れた保湿力で乾燥しがちな肌を守りつつ、つけたてのさらさら肌を長時間キープ。ニキビのもとになりにくい処方。<br>●パフ付き。無香料。<br>●スーパーヒアルロン酸・シルクパウダー・8種のアミノ酸・カモミラエキス（うるおい成分）配合<br>●ニキビのもとになりにくい処方。<br>●SPF18　PA++。<br><br>【使用方法】<br>●中蓋のシールをはがしてからお使いください。<br>●パフに適量をとり、手の甲などで調整してからお肌にのばしてください。<br>●必要に応じてフェイスブラシで余分なパウダーをはらい落してください。<br><br>【ご注意】<br>○傷、はれもの、湿疹等、異常のあるときは、ご使用をおやめください。<br>○使用中、又は使用後日光にあたって、赤味、はれ、かゆみ、刺激等の異常があらわれたときは、使用を中止し、皮フ科専門医又は株式会社 伊勢半へご相談をおすすめします。そのまま他の化粧品も含めて使用を続けますと悪化することがあります。<br>○使用後はしっかりキャップを閉めてください。<br>○パフはいつも清潔にしてお使いください。汚れたときは、中性洗剤で軽く押し洗いし、よくすすいだ後、かげ干ししてください。<br>○高温及び直射日光のあたる場所には置かないでください。<br>○使用量が少ないと、十分な紫外線防止効果が得られません。<br>○商品に表示されているSPF値及びPA値は、国際的に定められている標準塗布量に従い1平方cmあたり2mgを塗布して測定した値です。<br><br>【成分】<br>タルク、メタクリル酸メチルクロスポリマー、アクリレーツクロスポリマー、(ビニルジメチコン/メチコンシルセスキオキサン)クロスポリマー、(ジメチコン/ビニルジメチコン)クロスポリマー、マイカ、酸化チタン、ラウロイルリシン、メトキシケイヒ酸エチルヘキシル、酸化亜鉛、合成金雲母、フェニルトリメチコン、ベタイン、カミツレエキス、シルク、グリシン、セリン、グルタミン酸、アセチルヒアルロン酸Na、アラニン、トレオニン、リシン、プロリン、ジフェニルシロキシフェニルトリメチコン、リンゴ酸ジイソステアリル、水酸化Al、ステアリン酸、セバシン酸イソステアリル、ジメチコノール、メチコン、プロピルパラベン、ステアロイルグルタミン酸2Na、トリ(カプリル酸/カプリン酸)グリセリル、水、BHT、PCA-Na、ソルビトール、メチルパラベン、アルギニン、ジメチコン、酸化鉄<br><br>【内容量】<br>6g<br><br>【原産国】<br>日本<br><br>【販売元・製造元・輸入者名】<br>伊勢半<br>東京都千代田区四番町6番11号<br>0120-414-793<br><br>【商品区分】<br>化粧品<br><br>［kiss フェイスパウダー］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
