【ママバター フェイスパウダー ナチュラルの詳細】<br>●天然シアバターの潤いでスキンケアするミネラルフェイスパウダー。<br>●パウダーなのにシアバターを5%も配合し、一日中続く「潤い」を実感していただけます。重ねづけをしても、よれずにしっとりとした仕上がりで、スキンケアしながらベースメイクが叶います。<br>●SPF25 PA++。<br><br>【使用方法】<br>●BBクリームや、ファンデーションなどを塗布した後、付属のパフに適量をとり、お肌に優しくなじませてください。<br>●素肌感メークを楽しまれたい方は、化粧下地や日焼け止めを塗布した後にそのままお使いください。<br>●こぼれの原因になりますので、必ずパフを入れてからケースの蓋をしめてください。<br>●パフは清潔にし、定期的に洗浄してください。<br><br>【ご注意】<br>○お肌に合わない時はご使用を中止して下さい。<br>○使用中または使用後に刺激などの異常が現れた場合、ご使用を中止し、皮膚科専門医等にご相談をお勧めいたします。<br>○乳幼児の手の届かない所に保管して下さい。<br>○極端に低温または高温になる場所や直射日光をさけ保管して下さい。<br>○天然由来成分配合のため、色・香りの変化やざらつきが出る場合もございますがご使用には問題ございません。<br>○開封後は半年を目安にお使いきりください。<br><br>【成分】<br>タルク、シア脂、シリカ、スクワラン、酸化亜鉛、ラベンダー油、ラベンダー花エキス、ホホバ種子油、カニナバラ果実エキス、ローズマリー葉エキス、ビルベリー葉エキス、タチジャコソウ花／葉エキス、セージエキス、ステアリン酸、水、BG、エタノール、(+／-)、マイカ、酸化チタン、酸化鉄、水酸化AL<br><br>【内容量】<br>8g<br><br>【原産国】<br>日本<br><br>【販売元・製造元・輸入者名】<br>ビーバイイー<br>東京都渋谷区代官山町20-23代官山東急アパ－ト502<br>03-5456-8228<br><br>【商品区分】<br>化粧品<br><br>［MAMA BUTTER フェイスパウダー］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
