【キャンメイク トランスペアレント フィニッシュパウダー PL パールラベンダーの詳細】<br>
●SPF41・PA++。<br>
●テカリやくすみをカットする、サラリとなめらかなつけ心地のフェイスパウダー。<br>●繊細なパールが上品なツヤ感を実現！<br>
●毛穴や色ムラをキレイにカバーしてくれるのに、厚塗り感なしでナチュラルな仕上がり。<br>
●まるで真珠みたいなツヤ肌、透明感あふれる女の子らしいピュア顔完成！<br>
●美容液成分配合で、お肌に優しいつけ心地。<br><br>

【使用方法】<br>
●化粧下地で肌を整え、ファンデーション（クリーム・リキッドタイプがおすすめ）を塗った後、パフに適量を取り、お肌にポンポンと優しくあてながら重ねます。<br>
●ナチュラルメイクに仕上げたい時は、ファンデーションの代わりに使用できます。<br>●小鼻の周りなどの細かい部分や、特に毛穴が気になる部分には、更にポンポンと軽く叩くようにお肌にのせると、キレイにカバーできます。<br>
●パフは清潔な状態でお使い下さい。<br>
●フィルムは捨てずにお使い下さい。<br>
●キャンメイク フェイスブラシを使うとさらに磨いたようなシルク肌が完成します！<br><br>

【成分】<br>
タルク、マイカ、メトキシケイヒ酸エチルヘキシル、酸化チタン、合成フルオロフロゴパイト、PTFE、グンジョウ、(ジメチコン／ビニルジメチコン)クロスポリマー、ステアリン酸Mg、アルミナ、ジメチコン、リンゴ酸ジイソステアリル、イソステアリン酸グリセリル、ハイドロゲンジメチコン、スクワラン、メチルパラベン、トコフェロール、エチルヘキサン酸セチル、ホホバ種子油、水酸化AL、水添パーム核油、メチコン、ヘキサ(ヒドロキシステアリン酸／ステアリン酸／ロジン酸)ジペンタエリスリチル、イソステアリン酸水添ヒマシ油、酸化スズ、(水添ロジン／ジイソステアリン酸)グリセリル、BG、水、ブドウ種子油、オリーブ果実油、酸化鉄、アロエベラ葉エキス、ヤシ油、セイヨウトチノキ種子エキス、ローズマリー葉エキス、カミツレ花エキス、レモン果実エキス、加水分解コンキオリン、シソ葉エキス<br><br>

【内容量】<br>
1個<br><br>

